import React, { useState } from 'react';
import { Container, Typography, TextField, Button, Dialog, DialogActions, DialogContent, DialogContentText, DialogTitle } from '@mui/material';
import { useHistory } from 'react-router-dom';


function LoginPage() {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [open, setOpen] = useState(true);
    const history = useHistory();

    const handleLoginSubmit = (e) => {
        e.preventDefault();
        // Simulate authentication
        fetch('/api/authenticate', {
            method: 'POST',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify({ email, password }),
        })
        .then(response => response.json())
        .then(data => {
            if (data.success) {
                history.push('/booking');
            } else {
                alert('Invalid email or password');
            }
        });
    };

    return (
        <Container>
            <Dialog open={open} onClose={() => setOpen(false)}>
                <DialogTitle>Teacher Login</DialogTitle>
                <DialogContent>
                    <DialogContentText>
                        Please enter your college email and password to book a classroom.
                    </DialogContentText>
                    <TextField
                        autoFocus
                        margin="dense"
                        label="Email Address"
                        type="email"
                        fullWidth
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                    />
                    <TextField
                        margin="dense"
                        label="Password"
                        type="password"
                        fullWidth
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                    />
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleLoginSubmit} color="primary">
                        Login
                    </Button>
                </DialogActions>
            </Dialog>
        </Container>
    );
}

export default LoginPage;
